import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';



const Servicios = (props) => {
    return (
        <Box sx={{ flexGrow: 1 }}>
        <Grid container spacing={3}>
          <Grid item xs>
            <Item>xs</Item>
          </Grid>
          <Grid item xs={6}>
            <Item>xs=6</Item>
          </Grid>
          <Grid item xs>
            <Item>xs</Item>
          </Grid>
        </Grid>
      </Box>
        );
    }

